import './react-remake.css';

import Link from 'next/link';
import React from 'react';

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <img src={'https://img.pokemondb.net/artwork/bulbasaur.jpg'} className="App-logo"/>
          <p>
            Welcome to michaeldipaolo.com 
          </p>

          <Link href="/resume">
              <a className='App-link'>Continue to my resume</a>
          </Link>

        </header>

      </div>
  );
}

export default App;
